import React from "react";
function Users() {
  return (
    <div className="container" style={{ textAlign: "center" }}>
      <div className="" style={{ fontSize: "30px" }}>
        WE
      </div>
      <div className="" style={{ fontSize: "30px" }}>
        <img
          src="https://st2.depositphotos.com/1006689/10063/v/950/depositphotos_100630250-stock-illustration-heart-vector-icon.jpg"
          alt=""
          style={{ width: "300px" }}
        />
      </div>
      <div className="" style={{ fontSize: "30px" }}>
        The Scouts
      </div>
    </div>
  );
}

export default Users;
